import React, { useState } from 'react';
import './Header.css'; // Import the CSS file for styling

const Header = ({ title }) => {
  const [searchQueryMedium, setSearchQueryMedium] = useState('');
  const [searchQuerySession, setSearchQuerySession] = useState('');
  

  const handleSearchInputChangeMedium = (e) => {
    setSearchQueryMedium(e.target.value);
    console.log('Search Query Medium:', searchQueryMedium);
  };

  const handleSearchInputChangeSession = (e) => {
    setSearchQuerySession(e.target.value);
    console.log('Search Query Session:', searchQuerySession);
  };

  

  const handleSearchSubmit = (e) => {
    e.preventDefault();
    console.log('Search Submitted Medium:', searchQueryMedium);
    console.log('Search Submitted Session:', searchQuerySession);
   
  };

  return (
    <div className="header-container header-background">
      <h1 className="header-title">{title}</h1>
      <form onSubmit={handleSearchSubmit}>
        <label htmlFor="searchInputMedium" className="header-label">Medium</label>
        <input
          id="searchInputMedium"
          type="text"
          placeholder="Search..."
          value={searchQueryMedium}
          onChange={handleSearchInputChangeMedium}
          className="header-textbox"
        />
        <label htmlFor="searchInputSession" className="header-label">Session</label>
        <input
          id="searchInputSession"
          type="text"
          placeholder="Search..."
          value={searchQuerySession}
          onChange={handleSearchInputChangeSession}
          className="header-textbox"
        />
        
        <button type="submit" className="search-button">Search</button>
      </form>
    </div>
  );
};


export default Header;
